import React, { Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">

        <main>
          <div>
            <div className='container'>
              <div className = 'item'>Black Mirror</div>
              <div className = 'item'>Man in Black</div>
              <div className = 'item'>Star Wars</div>
            </div>
            <div className='container'>
              <div className = 'item'>Black Mirror</div>
              <div className = 'item'>Man in Black</div>
              <div className = 'item'>Star Wars</div>
            </div>
          </div>

        </main>
      </div>
    );
  }
}

export default App;
